export var statusColorClass = function(status) {
    switch(status) {
        case 'ACCEPTED':
          return 'bar';
        case 'PENDING':
          return 'bar';
        case 'NEW':
            return 'bar';
        case 'CLOSED':
            return 'bar';
        default:
          return 'foo';
      }
};
